window.bookSummaryJSON = "<p>Imagine yourself in Cape Cod in early fall with the steady swells of the waves falling against the sand and the gentle rhythmic chirp of crickets in the dunes.&nbsp;&nbsp;&nbsp;&nbsp;</p> <p>Unlike canned nature sounds created in a studio, renowned acoustic ecologist Gordon Hempton gives you the real deal. He travels the world recording remarkable locations that capture the essence of the place itself. His lifelong mission is to preserve nature through sound, and his soundscapes are produced with such care and quality that you feel as if he has truly brought a slice of the world into your home.&nbsp;&nbsp;&nbsp;</p> <p>This title is part of The Audible Sleep Collection, exclusive audio experiences created to help you fall asleep, stay asleep, and wake up in the right morning mindset. New and free for members.</p>"; 
